ry\",\"intellectual minds\",\"stephen fry greek mythology\",\"sit down chat\"],\"channelId\":\"UCp7LPFmh6pyFpWQY6htER3A\",\"isOwnerViewing\":false,\"shortDescription\":\"Stephen Fry and Richard Dawkins, two of the most respected minds in their respective fields, sit together on the CSICon stage to discuss science, religion, politics, and more.\\n\\nThe Center for Inquiry is a 501(c)(3) charitable nonprofit organization. CFI’s vision is a world in which evidence, science, and compassion—rather than superstition, pseudoscience, or prejudice—guide public policy.\\n\\nYou can join CFI and find out what we do to protect critical thinking and science by visiting: https:\/\/centerforinquiry.org\\n\\nStephen Fry is an English actor, screenwriter, author, playwright, journalist, poet, comedian, television presenter, film director and all round national treasure. Stephen’s new book, Mythos, his unique retelling of the Greek myths, was published in November 2017 and he is currently working on a one man stage show of the book for a first run at the Shaw Festival in Niagara.\\n\\nRichard Dawkins is one of the most respected scientists in the world and an internationally best-selling author. Among his books are The Selfish Gene, The God Delusion, and his autobiography A Brief Candle in the Dark. He is a fellow of the Royal Society and of the Royal Society of Literature.\\n\\nThis talk took place at the CSICon 2018 in Las Vegas on October 20, 2018\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/SYPZwZud_PA\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBH6oSFq-Zdf7HaSpPVHgW086JpRg\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/SYPZwZud_PA\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAuwI9Y2y1nJbyXJuGRdp81oZ1ONA\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/SYPZwZud_PA\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBS on. CFI’s vision is a world in which evidence, science, and compassion—rather than superstition, pseudoscience, or prejudice—guide public policy.\\n\\nYou can join CFI and find out what we do to protect critical thinking and science by visiting: https:\/\/centerforinquiry.org\\n\\nStephen Fry is an English actor, screenwriter, author, playwright, journalist, poet, comedian, television presenter, film director and all round national treasure. Stephen’s new book, Mythos, his unique retelling of the Greek myths, was published in November 2017 and he is currently working on a one man stage show of the book for a first run at the Shaw Festival in Niagara.\\n\\nRichard Dawkins is one of the most respected scientists in the world and an internationally best-selling author. Among his books are The Selfish Gene, The God Delusion, and his autobiography A Brief Candle in the Dark. He is a fellow of the Royal Society and of the Royal Society of Literature.\\n\\nThis talk took place at the CSICon 2018 in Las Vegas on October 20, 2018\"},\"lengthSeconds\":\"3311\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/centerforinquiry\",\"externalChannelId\":\"UCp7LPFmh6pyFpWQY6htER3A\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",
